    "content":`<p style="text-indent:37px;line-height:39px"><span style="font-size:19px;font-family:宋体">为推动市场治理体制机制创新，优化营商环境，增强发展活力，实现全省市场高质量和现代化发展</span><span style="font-size:19px">,</span><span style="font-size:19px;font-family:宋体">浙江省市场监督管理局在今年市场改造提升工作中对市场提出新要求、新标准。打造一批五化市场是贯彻落实省委十四届六次全会关于“加快最多跑一次改革延伸覆盖，推动公共场所服务大提升”的决策部署。五化市场服务体系是指便利化、智慧化、人性化、特色化、规范化</span><span style="font-size:19px">”</span><span style="font-size:19px;font-family:宋体">为一体的市场服务体系。</span></p><p style="text-indent:37px;line-height:39px"><span style="font-size:19px;font-family:宋体">根据《浙江省农贸市场和专业市场</span> <span style="font-size:19px;font-family: 宋体">“五化”提升行动方案》（浙市监〔</span><span style="font-size:19px">2020</span><span style="font-size:19px;font-family:宋体">〕</span><span style="font-size:19px">7</span><span style="font-size:19px;font-family:宋体">号）文件要求，</span><span style="font-size:19px">2020</span><span style="font-size:19px;font-family:宋体">年桐乡市列入全省农贸市场和专业市场“五化”（便利化、智慧化、人性化、特色化、规范化）提升第一批创建的市场有</span><span style="font-size:19px">3</span><span style="font-size:19px;font-family:宋体">家，分别是：桐乡市第二中心菜场、桐乡市崇福集贸市场、桐乡市濮院羊毛衫市场（集群）。</span></p><p style="text-indent:37px;line-height:39px"><span style="font-size:19px;font-family:宋体">为扎实推动此项工作进展，濮院管委会成立羊毛衫市场五化创建专班，此次五化创建，涉及七个专业市场，包括股份公司、时尚中心、国贸名品港、世贸大厦、濮院毛衫城、中央商城、时装城。五化创建专班对各市场的任务进行梳理和细化，要求七大市场对照执行，并通过走访及每周例会形式，了解各市场的短板及亮点，创建过程中的困难，督促各市场改造提升，力争早日达到五化创建要求。</span></p><p style="text-indent:37px;line-height:39px"><span style="font-size:19px;font-family:宋体">浙江省市场监督管理局五化市场创建目标是至</span><span style="font-size:19px">2021</span><span style="font-size:19px;font-family:宋体">年</span><span style="font-size:19px">6</span><span style="font-size:19px;font-family:宋体">月底，全省有不少于</span><span style="font-size:19px">200</span><span style="font-size:19px;font-family:宋体">家农贸市场和专业市场达到</span><span style="font-size:19px">“</span><span style="font-size:19px;font-family:宋体">五化</span><span style="font-size:19px">”</span><span style="font-size:19px;font-family:宋体">标准；</span><span style="font-size:19px">2022</span><span style="font-size:19px;font-family:宋体">年杭州亚运会举办前，全省五星级、四星级农贸市场和专业市场实现</span><span style="font-size:19px">“</span><span style="font-size:19px;font-family:宋体">五化</span><span style="font-size:19px">”</span><span style="font-size:19px;font-family:宋体">达标全覆盖，全省</span><span style="font-size:19px">80%</span><span style="font-size:19px;font-family:宋体">以上的城区三星级农贸市场和专业市场达到</span><span style="font-size:19px">“</span><span style="font-size:19px;font-family:宋体">五化</span><span style="font-size:19px">”</span><span style="font-size:19px;font-family:宋体">标准。</span></p><p> </p><p><br/></p>`,
